func TestJsonSigningPDFSSL(t *testing.T) {
	bodySign := BodyRequestPDFSignSSL{
		PdfData:                   ``,
		SadData:                   ``,
		CadData:                   "sy1ORJpPOgb/vnoPFmONy5CqmJmnDWJgYbktGosoeUg6ZqcaUnxoBb4502Szcn5A1F7YBrxU6f7Ujs6loCJHdwuRWNb3tKM/feaByEWNXktHsNTtraOKe3iDL5qUmIOZiqmhCcJwef6CVcEzsnb4tqKCvkCTm3SKtZbBiunQ9os=",
		Reason:                    `1111`,
		Location:                  `TH`,
		CertifyLevel:              `NON-CERTIFY`,
		HashAlgorithm:             `sha-256`,
		OverwriteOriginal:         true,
		VisibleSignature:          `Invisible`,
		VisibleSignaturePage:      1,
		VisibleSignatureRectangle: `0.7, 0.1, 0.2, 0.1`,
		VisibleSignatureImagePath: ``,
	}

	filePathSSL := SSLConFig{
		CertFile: "./cert-moph-test/moph.cer",
		KeyFile:  "./cert-moph-test/moph.pem",
		CaFile:   "./cert-moph-test/root.cer",
	}

	var response JsonPDFSigningResponse
	if err := sign.InitSSL(filePathSSL).JsonSigningPDFSSL("https://uat-sign.one.th", bodySign, &response).Error(); err != nil {
		panic(err)
	}

	assert.Equal(t, response.ResponseMessage, "PDF signing complete.")
}

